package com.webauthn4j.extras.fido.metadata;

import com.webauthn4j.registry.Registry;
import com.webauthn4j.util.Base64Util;
import com.webauthn4j.util.CertificateUtil;
import org.junit.Test;

import java.security.cert.X509Certificate;
import java.time.OffsetDateTime;
import java.time.ZoneOffset;
import java.util.HashMap;

import static org.assertj.core.api.Assertions.assertThat;
import static org.mockito.ArgumentMatchers.any;
import static org.mockito.Mockito.mock;
import static org.mockito.Mockito.when;

public class MetadataItemStatementProviderTest {

    private HttpClient fidoMDSClient = mock(HttpClient.class);
    private FidoMdsMetadataItemListProvider target = new FidoMdsMetadataItemListProvider(new Registry(), fidoMDSClient);
    private OffsetDateTime now = OffsetDateTime.now(ZoneOffset.UTC);

    @Test
    public void needsRefresh_test_with_cache_null() {
        target.cachedMetadataItemMap = null;
        assertThat(target.needsRefresh()).isTrue();
    }

    @Test
    public void needsRefresh_test_with_future_nextUpdate() {
        target.cachedMetadataItemMap = new HashMap<>();
        target.nextUpdate = now.plusDays(1);
        target.lastRefresh = now.minusWeeks(1);

        assertThat(target.needsRefresh()).isFalse();
    }

    @Test
    public void needsRefresh_test_with_equal_nextUpdate_and_lastRefresh_within_one_hour() {
        target.cachedMetadataItemMap = new HashMap<>();
        target.nextUpdate = now;
        target.lastRefresh = now.minusMinutes(59);

        assertThat(target.needsRefresh()).isFalse();
    }

    @Test
    public void needsRefresh_test_with_past_nextUpdate() {
        target.cachedMetadataItemMap = new HashMap<>();
        target.nextUpdate = now.minusDays(1);
        target.lastRefresh = now.minusWeeks(1);

        assertThat(target.needsRefresh()).isTrue();
    }

    @Test
    public void fetchMetadataTOCPayload_test(){
        String toc = "..87kNV5Zr3ccpmiEEjj1pEfJx2U6KCSs4fZYB3E5BJpjYshKUlTDm2OPDrWL6XDsadczpBUVsT-x5A7bgfrkNBw";
        when(fidoMDSClient.fetch(any())).thenReturn(toc);
        target.fetchMetadataTOCPayload();
    }

    @Test
    public void fetchMetadataTOCPayload_with_invalid_nextUpdate_ISO1801_test(){
        String toc = "..yom5hwLurFNO8h0_9F4snhnmBm2YTrSn-L7K2s8TjzaZpUTSpPKZnFcMw-hntxFUIwY_PzIbl_LhKQsXEo_3yA";
        when(fidoMDSClient.fetch(any())).thenReturn(toc);

        X509Certificate rootCert = CertificateUtil.generateX509Certificate(Base64Util.decode(""));
        target = new FidoMdsMetadataItemListProvider(new Registry(), fidoMDSClient, rootCert);
        target.fetchMetadataTOCPayload();
    }
}
